Patch Set 3:

(2 comments)

@Kairat -- thank you for the recommendation for debtcollector.  It is included in an upcoming patch.

Patch Set 4:

@Dane -- the latter.  The plan is to include the deprecation warning for the sign-the-hash approach alongside the implementation of the sign-the-data approach.  They can exist simultaneously since the sign-the-data approach uses "img" in the property names.

The spec for including both is at http://specs.openstack.org/openstack/glance-specs/specs/mitaka/approved/image-signing-and-verification-support.html
